  const { addCategory } = context;

  const category = {};

  return (
    <Modal trigger={<Button primary>Add new Category</Button>}>
      <Modal.Header>Add new Category</Modal.Header>
      <Modal.Content>
        <Form>
          <Form.Input id="name" n label="Name" placeholder="Category name" />
          <Form.Input label="Image" placeholder="Image URL" />
          <Button type="submit">Add</Button>
        </Form>
      </Modal.Content>
    </Modal>
  );
}
